    const {token} = useContext(contextAuth);
    const [annonces, setannonces] = useState([]);

  return (
    <div>
        <FormAnnonces token={token} annonces={annonces} setannonces={setannonces}/>
        <ListesAnnonces token={token} annonces={annonces} setannonces={setannonces}/>
    </div>
    
  )
}
